import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { HomeComponent } from './pages/home/home.component';
import { RentersComponent } from './pages/renters/renters.component';
import { CarComponent } from './pages/car/car.component';
import { HomeownersComponent } from './pages/homeowners/homeowners.component';
import { PetComponent } from './pages/pet/pet.component';
import { LifeComponent } from './pages/life/life.component';


const routes: Routes = [
  { path: '', component: HomeComponent },
  { path: 'about', component: RentersComponent },
  { path: 'car', component: CarComponent },
  { path: 'homeowners', component: HomeownersComponent },
  { path: 'pet', component: PetComponent },
  { path: 'life', component: LifeComponent },
  { path: '**', redirectTo: '' }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
